import { Divider as BaseDivider, DividerRoles, } from "@microsoft/fast-components-react-base";
import dividerSchema from "./divider.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { DividerStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Divider = manageJss(DividerStyles)(BaseDivider);
export { Divider, DividerRoles, dividerSchema, };
